/****** Object:  StoredProcedure [dbo].[OBTENER_DATOS_PAGO]    Script Date: 16/11/2017 22:22:22 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE procedure [dbo].[OBTENER_DATOS_PAGO]
(
  @PROF_ID int
  --set @prof_id = 8
  )
  as 
  begin
  select
   distinct pco.CODIGO_CLIENTE,
   (select NOMBRES + ' ' + PRIMER_APELLIDO + ' ' + SEGUNDO_APELLIDO from CLIE_CLIENTE clie where clie.ID = pco.clie_id) as NOMBRE_CLIENTE,
   (select MIN(cp.FECHA_HORA_INICIO) from CPO_CUPO cp where cp.PCO_ID = pco.ID ) as PRIMERA_FECHA,
   (select COUNT(*) from CPO_CUPO cp where cp.PCO_ID = pco.ID ) as TOTAL,
   (select COUNT(*) from CPO_CUPO cp where cp.PCO_ID = pco.ID and cp.ESTADO_CUPO = 3 ) as CERRADAS,
   PCO.ESTA_PAGADO
   from 
   PCO_PRODUCTO_CODIGO pco left join CPO_CUPO cpo on pco.ID = cpo.PCO_ID where cpo.PROF_ID = @prof_id
   end
GO
/****** Object:  StoredProcedure [dbo].[OBTENER_DATOS_PAGO_COMPLETO]    Script Date: 16/11/2017 22:22:22 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
create PROCEDURE [dbo].[OBTENER_DATOS_PAGO_COMPLETO]
 (
	@fecha_inio datetime, 
	@fecha_termino datetime, 
	@cantidad_clases int
 )
 AS
 BEGIN
  --declare @fecha_inio datetime, @fecha_termino datetime, @cantidad_clases int
  --set @fecha_inio = '01-01-2017'
  --set @fecha_termino = '01-02-2017'
  --set @cantidad_clases = 8
  

  DECLARE @TABLA TABLE (CODIGO_CLIENTE VARCHAR(100), PROFESOR VARCHAR(200), NOMBRE_CLIENTE VARCHAR(200), PRIMERA_FECHA DATETIME, TOTAL INT, CERRADAS INT, ESTA_PAGADO INT)

  INSERT @TABLA
  select
  
   distinct pco.CODIGO_CLIENTE,
   prof.Nombres + ' ' + prof.PRIMER_APELLIDO + ' ' + prof.SEGUNDO_APELLIDO as PROFESOR,
   (select NOMBRES + ' ' + PRIMER_APELLIDO + ' ' + SEGUNDO_APELLIDO from CLIE_CLIENTE clie where clie.ID = pco.clie_id) as NOMBRE_CLIENTE,
   (select MIN(cp.FECHA_HORA_INICIO) from CPO_CUPO cp where cp.PCO_ID = pco.ID) as PRIMERA_FECHA,
   (select COUNT(*) from CPO_CUPO cp where cp.PCO_ID = pco.ID ) as TOTAL,
   (select COUNT(*) from CPO_CUPO cp where cp.PCO_ID = pco.ID and cp.ESTADO_CUPO = 3 ) as CERRADAS,
   PCO.ESTA_PAGADO
   from 
   PCO_PRODUCTO_CODIGO pco left join CPO_CUPO cpo on pco.ID = cpo.PCO_ID
   inner join PROF_PROFESOR prof on prof.ID = cpo.PROF_ID
   --where PRIMERA_FECHA BETWEEN @fecha_inio  AND @fecha_termino
   ORDER BY PROFESOR

   IF @cantidad_clases = 0
   BEGIN
   SELECT * FROM @TABLA WHERE PRIMERA_FECHA BETWEEN @fecha_inio AND @fecha_termino
   END
   ELSE
   BEGIN
   SELECT * FROM @TABLA WHERE PRIMERA_FECHA BETWEEN @fecha_inio AND @fecha_termino AND CERRADAS = @cantidad_clases
   END

   END
GO
/****** Object:  StoredProcedure [dbo].[OBTENER_MATRIZ_PROFESORES]    Script Date: 16/11/2017 22:22:22 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO

CREATE PROCEDURE [dbo].[OBTENER_MATRIZ_PROFESORES]
(
	@fechaint int
)
as
begin
declare @anno varchar(4)
declare @mes varchar(2)
declare @dia varchar(2)
declare @fechaStr varchar(14)
set @anno = SUBSTRING(convert(varchar, @fechaint), 1, 4)
set @mes = SUBSTRING(convert(varchar, @fechaint), 5, 2)
set @dia = SUBSTRING(convert(varchar, @fechaint), 7, 2)

set @fechaStr = @anno + '-' + @mes + '-' + @dia
--print @fechaStr
--select @fechaStr
--select @mes
--select @dia



select 
	DISTINCT
	prof.ID, prof.NOMBRES + ' ' + prof.PRIMER_APELLIDO + ' ' + prof.SEGUNDO_APELLIDO as NOMBRES
	, CASE WHEN pco.CODIGO_CLIENTE IS NULL THEN 'Disponible' ELSE pco.CODIGO_CLIENTE END AS CODIGO_CLIENTE, cpo.FECHA_HORA_INICIO, cpo.FECHA_HORA_TERMINO
from 
	PROF_PROFESOR prof INNER join CPO_CUPO cpo on cpo.PROF_ID = prof.ID
	LEFT join PCO_PRODUCTO_CODIGO pco on pco.ID = cpo.PCO_ID
where
	cpo.FECHA_HORA_INICIO between @fechaStr + ' 10:00' and @fechaStr + ' 10:45'
	--and cpo.PCO_ID > 0 
	and prof.ACTIVO = 1 and prof.ELIMINADO = 0
union all
select 
	DISTINCT
	prof.ID, prof.NOMBRES + ' ' + prof.PRIMER_APELLIDO + ' ' + prof.SEGUNDO_APELLIDO as NOMBRES
	, CASE WHEN pco.CODIGO_CLIENTE IS NULL THEN 'Disponible' ELSE pco.CODIGO_CLIENTE END AS CODIGO_CLIENTE, cpo.FECHA_HORA_INICIO, cpo.FECHA_HORA_TERMINO
from 
	PROF_PROFESOR prof INNER join CPO_CUPO cpo on cpo.PROF_ID = prof.ID
	LEFT join PCO_PRODUCTO_CODIGO pco on pco.ID = cpo.PCO_ID
where
	cpo.FECHA_HORA_INICIO between @fechaStr + ' 11:15' and @fechaStr + ' 12:00'
	--and cpo.PCO_ID > 0 
	and prof.ACTIVO = 1 and prof.ELIMINADO = 0
union all
select 
	DISTINCT
	prof.ID, prof.NOMBRES + ' ' + prof.PRIMER_APELLIDO + ' ' + prof.SEGUNDO_APELLIDO as NOMBRES
	, CASE WHEN pco.CODIGO_CLIENTE IS NULL THEN 'Disponible' ELSE pco.CODIGO_CLIENTE END AS CODIGO_CLIENTE, cpo.FECHA_HORA_INICIO, cpo.FECHA_HORA_TERMINO
from 
	PROF_PROFESOR prof INNER join CPO_CUPO cpo on cpo.PROF_ID = prof.ID
	LEFT join PCO_PRODUCTO_CODIGO pco on pco.ID = cpo.PCO_ID
where
	cpo.FECHA_HORA_INICIO between @fechaStr + ' 12:30' and @fechaStr + ' 13:15'
	--and cpo.PCO_ID > 0 
	and prof.ACTIVO = 1 and prof.ELIMINADO = 0
union all
select 
	DISTINCT
	prof.ID, prof.NOMBRES + ' ' + prof.PRIMER_APELLIDO + ' ' + prof.SEGUNDO_APELLIDO as NOMBRES
	, CASE WHEN pco.CODIGO_CLIENTE IS NULL THEN 'Disponible' ELSE pco.CODIGO_CLIENTE END AS CODIGO_CLIENTE, cpo.FECHA_HORA_INICIO, cpo.FECHA_HORA_TERMINO
from 
	PROF_PROFESOR prof INNER join CPO_CUPO cpo on cpo.PROF_ID = prof.ID
	LEFT join PCO_PRODUCTO_CODIGO pco on pco.ID = cpo.PCO_ID
where
	cpo.FECHA_HORA_INICIO between @fechaStr + ' 14:45' and @fechaStr + ' 15:30'
	--and cpo.PCO_ID > 0 
	and prof.ACTIVO = 1 and prof.ELIMINADO = 0
union all
select 
	DISTINCT
	prof.ID, prof.NOMBRES + ' ' + prof.PRIMER_APELLIDO + ' ' + prof.SEGUNDO_APELLIDO as NOMBRES
	, CASE WHEN pco.CODIGO_CLIENTE IS NULL THEN 'Disponible' ELSE pco.CODIGO_CLIENTE END AS CODIGO_CLIENTE, cpo.FECHA_HORA_INICIO, cpo.FECHA_HORA_TERMINO
from 
	PROF_PROFESOR prof INNER join CPO_CUPO cpo on cpo.PROF_ID = prof.ID
	LEFT join PCO_PRODUCTO_CODIGO pco on pco.ID = cpo.PCO_ID
where
	cpo.FECHA_HORA_INICIO between @fechaStr + ' 16:00' and @fechaStr + ' 16:45'
	--and cpo.PCO_ID > 0 
	and prof.ACTIVO = 1 and prof.ELIMINADO = 0
union all
select
	DISTINCT 
	prof.ID, prof.NOMBRES + ' ' + prof.PRIMER_APELLIDO + ' ' + prof.SEGUNDO_APELLIDO as NOMBRES
	, CASE WHEN pco.CODIGO_CLIENTE IS NULL THEN 'Disponible' ELSE pco.CODIGO_CLIENTE END AS CODIGO_CLIENTE, cpo.FECHA_HORA_INICIO, cpo.FECHA_HORA_TERMINO
from 
	PROF_PROFESOR prof INNER join CPO_CUPO cpo on cpo.PROF_ID = prof.ID
	LEFT join PCO_PRODUCTO_CODIGO pco on pco.ID = cpo.PCO_ID
where
	cpo.FECHA_HORA_INICIO between @fechaStr + ' 17:15' and @fechaStr + ' 18:00'
	--and cpo.PCO_ID > 0 
	and prof.ACTIVO = 1 and prof.ELIMINADO = 0
	union all
select 
	DISTINCT
	prof.ID, prof.NOMBRES + ' ' + prof.PRIMER_APELLIDO + ' ' + prof.SEGUNDO_APELLIDO as NOMBRES
	, CASE WHEN pco.CODIGO_CLIENTE IS NULL THEN 'Disponible' ELSE pco.CODIGO_CLIENTE END AS CODIGO_CLIENTE, cpo.FECHA_HORA_INICIO, cpo.FECHA_HORA_TERMINO
from 
	PROF_PROFESOR prof INNER join CPO_CUPO cpo on cpo.PROF_ID = prof.ID
	LEFT join PCO_PRODUCTO_CODIGO pco on pco.ID = cpo.PCO_ID
where
	cpo.FECHA_HORA_INICIO between @fechaStr + ' 18:30' and @fechaStr + ' 19:15'
	--and cpo.PCO_ID > 0 
	and prof.ACTIVO = 1 and prof.ELIMINADO = 0

end

GO
/****** Object:  StoredProcedure [dbo].[OBTENER_PACKS_PROFESORES]    Script Date: 16/11/2017 22:22:22 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
create PROCEDURE [dbo].[OBTENER_PACKS_PROFESORES]
AS
BEGIN

select
	PCO.FECHA_CREACION,
	(SELECT TOP 1 FECHA_HORA_INICIO FROM CPO_CUPO CP2 WHERE CP2.PCO_ID = pco.ID ORDER BY FECHA_HORA_INICIO) AS PRIMERA_CLASE,
	(SELECT TOP 1 NOMBRES + ' ' + PRIMER_APELLIDO + ' ' + SEGUNDO_APELLIDO FROM CPO_CUPO CP1 INNER JOIN  PROF_PROFESOR PROF1 ON PROF1.ID = CP1.PROF_ID WHERE CP1.PCO_ID = pco.ID AND PROF1.ACTIVO = 1 AND PROF1.ELIMINADO = 0)  as NOMBRE_PROFESOR,
	clie.NOMBRES + ' ' + clie.PRIMER_APELLIDO + ' ' + clie.SEGUNDO_APELLIDO as NOMBRE,
	pco.CODIGO_CLIENTE,
	(select COUNT(*) from CPO_CUPO cpo where cpo.PCO_ID = pco.ID  and cpo.ESTADO_CUPO = 2) as PENDIENTES,
	(select COUNT(*) from CPO_CUPO cpo where cpo.PCO_ID = pco.ID  and cpo.ESTADO_CUPO = 3) as CERRADAS,
	pco.CANTIDAD_CLASES as PROGRAMADAS,
	CASE pco.ESTA_PAGADO WHEN 0 THEN 'PACK NO PAGADO' ELSE 'PACK PAGADO' END AS ESTA_PAGADO
from 
PCO_PRODUCTO_CODIGO pco 
inner join CLIE_CLIENTE clie on clie.ID = pco.CLIE_ID
ORDER BY NOMBRE_PROFESOR 
END


GO
